import React, {Component} from "react";
import {Link} from "react-router-dom";
import {Header, Navigation} from "react-mdl";
import {logout} from "../../../actions/doctor";

class LoginHeader extends Component {
    state = {};
    logoutDoctor = (app) => {
        this.props.history.push("/doctorLogin");
        logout(app);
    };

    chatWithPatients = (app) => {
        app.setState(
            {
                selectedPatient: null
            }
        );
        this.props.history.push("/ChatPage/PreDoctorChat");
    };

    render() {
        const {app} = this.props;
        return (
            <div>
                <Header
                    title={
                        <Link className="Link" to="/DoctorHome">
                            {this.props.name + "'s profile"}
                        </Link>
                    }
                    className="header-color"
                >
                    <Navigation>
                        <Link to={"/"}>Homepage</Link>
                        <Link onClick={() => this.chatWithPatients(app)}>Chat With Patients</Link>
                        <Link onClick={() => this.logoutDoctor(app)}> Logout</Link>
                    </Navigation>
                </Header>
            </div>
        );
    }
}

export default LoginHeader;
